import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <nav style={styles.navbar}>
      <h2 style={styles.logo}>ByteGirls</h2>
      <ul style={styles.navLinks}>
        <li><Link to="/" style={styles.link} className="nav-item">Home</Link></li>
        <li><Link to="/outfit-tryon" style={styles.link} className="nav-item">Outfit Try-On</Link></li>
        <li><Link to="/ai-stylist" style={styles.link} className="nav-item">AI Stylist</Link></li>
        <li><Link to="/fashion-game" style={styles.link} className="nav-item">Fashion Game</Link></li>
      </ul>
    </nav>
  );
};

const styles = {
  navbar: {
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
    background: "#333",
    color: "white",
    padding: "10px 20px",
    boxShadow: "0 4px 10px rgba(0,0,0,0.1)"
  },
  logo: { margin: 0, fontSize: "24px", fontWeight: "bold" },
  navLinks: {
    listStyle: "none",
    display: "flex",
    gap: "20px",
    padding: 0,
    margin: 0
  },
  link: { 
    color: "white", 
    textDecoration: "none", 
    fontSize: "16px",
    transition: "color 0.3s ease-in-out, border-bottom 0.3s ease-in-out"
  }
};

export default Navbar;
